import React from "react";
import ReactDOM from "react-dom";
import cars from "./practice"; 

const[honda, tesla] = cars;


ReactDOM.render(
  <table>
    <thead>
      <tr>
        <th>Brand</th>
        <th>Top Speed</th>
        <th>Top Colour</th>
      </tr>
    </thead>
    <tbody>
      {cars.map((car, index) => (
        <tr key={index}>
          <td>{car.model}</td>
          <td>{car.topSpeed}</td>
          <td>{car.topColour}</td>
        </tr>
      ))}
    </tbody>
  </table>,
  document.getElementById("root")
);
